  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Parker
  River NWR (including the satellite refuges) outlines Refuge accomplishments during
  the 1981 calendar year. The report begins with a summary of the year's highlights
  and weather conditions. Land acquisition is covered. The report includes a planning
  section which discusses the master plan, management planning, public participation,
  compliance with environmental and cultural resource mandates, and research and investigations.
  Refuge administration is outlined; information about personnel, youth programs,
  manpower programs, volunteer programs, funding, safety, and technical assistance
  is given. Habitat management is also covered; subjects include wetlands, grasslands,
  haying, fire management, pest control, and wilderness areas. The wildlife section
  of the report discusses endangered and threatened species, waterfowl, marsh birds
  and waterbirds, shorebirds, raptors, game mammals, marine mammals, wildlife propagation,
  marking and bird banding, and disease control. The public uses of the Refuge described
  in this report include outdoor classrooms, interpretive programs, hunting, fishing,
  wildlife observation, outdoor recreation, and law enforcement. The equipment and
  facilities section of the report provides information about new construction, equipment
  replacement, and energy conservation. Items of interest are provided at the end.\",\n\t\"owner_org\":
